Here's an example of a regular expression in Python that can be used to validate an email address:
```python
import re

def validate_email(email):
    email_regex = r'\b[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z0-9]{2,}\b'
    return bool(re.match(email_regex, email))

email = input("Enter an email address: ")
if validate_email(email):
    print("The email address is valid!")
else:
    print("The email address is invalid!")
```
This regular expression matches email addresses in the format of [username@domain.com](mailto:username@domain.com). The `r` before the string indicates that it is a raw string, which is necessary for using special characters like the `@` and `.` characters in the regular expression. The `bool(re.match(email_regex, email))` checks whether the input string matches the email regex or not.
